        function initializeMap(latlngs, mapCenter) {
          geocoder = new google.maps.Geocoder();
          var mapOptions = {
            center: mapCenter,
            zoom: 15,
            scrollwheel: false,
            disableDefaultUI: false,
            mapTypeId: google.maps.MapTypeId.ROADMAP,
            styles: mapStyle
          };
          map = new google.maps.Map(document.getElementById('map-canvas'), mapOptions);
          google.maps.event.addListenerOnce(map, 'idle', function() {
             google.maps.event.trigger(map, 'resize');
          });

          var infowindow;
          
          $.each(latlngs, function(index, merchant) {
          	if(merchant.FIELD1 == 'Celeste Patisserie & Bistro')
          		console.log(merchant);
          	var mk = new google.maps.Marker({
          		position: new google.maps.LatLng(merchant.FIELD2, merchant.FIELD3),
          		icon: {
          			path: google.maps.SymbolPath.CIRCLE,
          			scale: 4,
          			strokeWeight: 1,
          			strokeColor: '#666666',
          			fillColor: '#fdd300',
          			fillOpacity: 1
          		},
          		title: merchant.FIELD1,
          		map: map,
          		zIndex: -999
          	});

          	var contentString = merchant.FIELD1;

          	google.maps.event.addListener(mk, 'click', function() {
          		if(infowindow) {
			        infowindow.close();
			    }
			    infowindow = new google.maps.InfoWindow({
				    content: contentString
				});
				infowindow.open(map, mk);
			});

          });

          	if (window.matchMedia('(max-width: 767px)').matches) {
	        	map.setOptions({draggable: false});
	    	} else {
	        	map.setOptions({draggable: true});
	    	}

	    	$('#map-canvas').on('click', function() {
	    		map.setOptions({draggable: true});
	  		});

        }

        if($(window).width() > 767) {
        	google.maps.visualRefresh = true;
          	// initializeMap(punMerchants, punCenter);
          	initializeMap(merchantLocs, myLatLng);
        	google.maps.event.trigger(map, 'resize');
	    }

